Points $B$, $D$, $E$, $F$, and $G$ lie on a circle with center $A$ as shown below, and point $C$ lies on line $AB$ outside the circle.  Suppose that 
    \[
    \angle FGB = 39^{\circ},\quad\angle DEF = 11^{\circ},\quad\text{and}\quad\angle DCA = 32^{\circ}.
    \] What is the measure of $\angle EDC$?
    \begin{figure}[ht]
        \centering
        \begin{asy}
        texpreamble("\usepackage{kpfonts}");
        size(250);
        defaultpen(linewidth(0.7)+fontsize(11));
        pair A = (0,0),  B = (1,0), D = dir(60), F = dir(40), G = dir(-20), E = -D, C = (-2.1,0);
        draw(unitcircle^^B--C--D--E--F--G--B);
        dot("$A$",A,NW,linewidth(3.3));
        dot("$B$",B,dir(0),linewidth(3.3));
        dot("$C$",C,dir(180),linewidth(3.3));
        dot("$D$",D,dir(A--D),linewidth(3.3));
        dot("$E$",E,dir(A--E),linewidth(3.3));
        dot("$F$",F,dir(A--F),linewidth(3.3));
        dot("$G$",G,dir(A--G),linewidth(3.3));
        \end{asy}
    \end{figure}
